import AssetsVolume from "./data/AssetsVolume";
import { assets } from "./data/data";

const totalArray = Object.keys(assets).map((item) =>
  AssetsVolume(assets[item])
);

export const total = totalArray.reduce((acc, item) => {
  return acc + item;
}, 0);
